var handleDataTableFixedHeader = function () {
        "use strict";
        0 !== $("#data-table-fixed-header").length && $("#data-table-fixed-header").DataTable({
            lengthMenu: [20, 40, 60],
            fixedHeader: {
                header: !0,
                headerOffset: $("#header").height()
            },
            responsive: !0
        })
    },
    TableManageFixedHeader = function () {
        "use strict";
        return {
            init: function () {
                handleDataTableFixedHeader()
            }
        }
    }();
